import React from "recat";
import Reactdom from "react-dom";
import Calculator from "./Calculator";

ReactDOM.render(
    <>
    <ul>
        <li>The sum of two numbers is {add(2,3)}</li>
        <li>The sub of two numbers is {sub(7,3)}</li>
        <li>The mul of two numbers is {mul(5,6)}</li>
        <li>The div of two numbers is {div(78,2)}</li>
    </ul>
    </>,document.getElementById("root")
);
